A Killer Whale Called Luna (BBC)

Nature Documentary hosted by Michael Parfit, published by BBC broadcasted as part of BBC Natural World series in 2010 - English narration


Information
------------------------------

The emotional story of a young killer whale's quest for companionship after he was separated from his family and found himself on the rugged, wild coast of Vancouver Island. The film records the human friendships he developed and the trouble this led him into. From death threats to numerous capture attempts by the government, the film-makers watched as various people tried to determine Luna's fate.

